{
  "properties": {
    "dataSources": {
      "performanceCounters": [
        {
          "streams": [
            "Microsoft-InsightsMetrics"
          ],
          "scheduledTransferPeriod": "PT1M",
          "samplingFrequencyInSeconds": 10,
          "counterSpecifiers": [
            "\\Memory\\% Committed Bytes In Use",
            "\\Memory\\Available Bytes",
            "\\Network Interface(*)\\Bytes Received/sec"
          ],
          "name": "perfCounterDataSource1"
        }
      ]
    },
    "destinations": {
      "azureMonitorMetrics": {
        "name": "ammDestination"
      }
    },
    "dataFlows": [
      {
        "streams": [
          "Microsoft-InsightsMetrics"
        ],
        "destinations": [
          "ammDestination"
        ]
      }
    ]
  },
  "location": "East US",
  "tags": {
    "tagOne": "valueOne",
    "tagTwo": "valueTwo"
  }
}

